<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Hamari Diary</title>
    <!-- Google Fonts -->
    <link
        href="https://fonts.googleapis.com/css2?family=Poppins:wght@300;500;700&family=Dancing+Script:wght@600&display=swap"
        rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            font-family: 'Poppins', sans-serif;
        }

        body {
            background-color: #0D0D0D;
            color: #E0E0E0;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            padding: 0;
            overflow-x: hidden;
        }

        header {
            width: 100%;
            position: relative;
            text-align: center;
            margin-bottom: 20px;
        }

        .header-photo {
            width: 70%;
            max-height: 350px;
            object-fit: recover;
            filter: brightness(0.9);
        }

        header h1 {
            position: absolute;
            bottom: 20px;
            left: 50%;
            transform: translateX(-50%);
            font-size: 2.5rem;
            font-family: 'Dancing Script', cursive;
            color: #FFB6C1;
            text-shadow: 0px 0px 10px #FF69B4, 0px 0px 25px #FF1493;
            animation: glow 2s infinite alternate;
        }

        @keyframes glow {
            from {
                text-shadow: 0px 0px 10px #FF69B4;
            }

            to {
                text-shadow: 0px 0px 25px #FF1493, 0px 0px 40px #FF69B4;
            }
        }

        .love-quote {
            text-align: center;
            font-family: 'Dancing Script', cursive;
            font-size: 1.5rem;
            color: #FFD1DC;
            margin: 15px;
            animation: fadeIn 2s ease-in-out;
        }

        @keyframes fadeIn {
            from {
                opacity: 0;
            }

            to {
                opacity: 1;
            }
        }

        .diary-container {
            display: flex;
            flex-direction: column;
            gap: 15px;
            background: rgba(255, 255, 255, 0.07);
            border: 1px solid #333;
            padding: 20px;
            border-radius: 12px;
            width: 95%;
            max-width: 900px;
            box-shadow: 0 0 20px rgba(255, 182, 193, 0.4);
            margin-bottom: 30px;
        }

        input[type="date"] {
            background: #1A1A1A;
            color: #FFD1DC;
            border: none;
            padding: 10px;
            font-size: 16px;
            border-radius: 8px;
        }

        textarea {
            background: #1A1A1A;
            border: none;
            color: #E0E0E0;
            padding: 15px;
            font-size: 18px;
            min-height: 300px;
            border-radius: 8px;
            line-height: 1.5;
        }

        button {
            background: #FF69B4;
            color: #fff;
            border: none;
            padding: 12px;
            font-size: 18px;
            border-radius: 8px;
            cursor: pointer;
            transition: 0.3s;
            font-weight: bold;
        }

        button:hover {
            background: #FF1493;
            transform: scale(1.05);
        }

        #entries-list {
            margin-top: 20px;
            width: 95%;
            max-width: 900px;
        }

        .entry {
            background: #1A1A1A;
            padding: 15px;
            margin-bottom: 15px;
            border-radius: 8px;
            border-left: 5px solid #FF69B4;
            animation: slideIn 1s ease-in-out;
        }

        @keyframes slideIn {
            from {
                transform: translateX(-50px);
                opacity: 0;
            }

            to {
                transform: translateX(0);
                opacity: 1;
            }
        }

        strong {
            color: #FFB6C1;
            font-size: 1.2rem;
        }
    </style>
</head>

        <h1>Hamari Pyaari Diary</h1>
    </header>

    <div class="love-quote">
        "          <br>           "
    </div>

    <main>
        <div class="diary-container">
            <input type="date" id="entry-date">
            <textarea id="entry-text" placeholder="Jaan aap apni dil ki baat khul kar likh sakti ho"></textarea>
            <button onclick="saveEntry()">Save My Feelings</button>
        </div>

        <h2 style="text-align:center; color:#FFB6C1; margin-bottom:10px;">Hamari Yaadein</h2>
        <div id="entries-list"></div>
    </main>

    <script>
        document.addEventListener('DOMContentLoaded', loadEntries);

        function saveEntry() {
            const date = document.getElementById('entry-date').value;
            const text = document.getElementById('entry-text').value;

            if (!date || !text) {
                alert("Date aur likhne ka jazbaat dono zaruri hai! ");
                return;
            }

            let entries = JSON.parse(localStorage.getItem('diaryEntries')) || [];
            entries.push({ date, text });
            localStorage.setItem('diaryEntries', JSON.stringify(entries));

            document.getElementById('entry-text').value = "";
            loadEntries();
        }

        function loadEntries() {
            const entriesList = document.getElementById('entries-list');
            entriesList.innerHTML = "";

            const entries = JSON.parse(localStorage.getItem('diaryEntries')) || [];
            entries.forEach(entry => {
                const div = document.createElement('div');
                div.classList.add('entry');
                div.innerHTML = `<strong>${entry.date}</strong><p>${entry.text}</p>`;
                entriesList.appendChild(div);
            });
        }
    </script>
</body>
